#include "glow.h"

//int selected_ent;

//auto global_glow_item = settings::visuals::glow::glow_items[selected_ent];

namespace glow
{
    void shutdown()
    {
        for (auto i = 0; i < g_glow_obj_manager->m_GlowObjectDefinitions.Count(); i++) {
            auto& glowObject = g_glow_obj_manager->m_GlowObjectDefinitions[i];
            auto entity = reinterpret_cast<c_base_player*>(glowObject.m_pEntity);

            if (glowObject.is_unused())
                continue;

            if (!entity || entity->is_dormant())
                continue;

            glowObject.m_flAlpha = 0.0f;
        }
        
    }

    void run()
    {
        for (auto i = 0; i < g_glow_obj_manager->m_GlowObjectDefinitions.Count(); i++) {
            auto& glowObject = g_glow_obj_manager->m_GlowObjectDefinitions[i];
            auto entity = reinterpret_cast<c_base_player*>(glowObject.m_pEntity);

            if (glowObject.is_unused())
                continue;

            if (!entity || entity->is_dormant())
                continue;

            auto class_id = entity->get_client_class()->m_ClassID;
            auto color = Color{};

            switch (class_id) {
            case 40:
            {
                auto is_enemy = entity->m_iTeamNum() != g_local_player->m_iTeamNum();

                if (entity->has_c4() && is_enemy && settings::visuals::glow::glow_c4carrier) {
                    color = Color(settings::visuals::glow::c4colorcarrier);
                    break;
                }

                if (!settings::visuals::glow::glow_players || !entity->is_alive())
                    continue;

                if (!is_enemy && settings::visuals::glow::glow_enemy)
                    continue;

                color = is_enemy ? Color(settings::visuals::glow::glow_enemycolor) : Color(settings::visuals::glow::glow_allycolor);

                break;
            }
            case CChicken:
                if (!settings::visuals::glow::galinha)
                    continue;
                entity->m_bShouldGlow() = true;
                color = Color(settings::visuals::glow::galinhacor);
                break;
            case CBaseAnimating:
                if (!settings::visuals::glow::defusekit)
                    continue;
                color = Color(settings::visuals::glow::defusekitcolor);
                break;
            case CPlantedC4:
                if (!settings::visuals::glow::planted_c4)
                    continue;
                color = Color(settings::visuals::glow::planted_c4color);
                break;
            default:
            {
                if (entity->is_weapon()) {
                    if (!settings::visuals::glow::weaponsglow)
                        continue;
                    color = Color(settings::visuals::glow::weaponsglowcolor);
                }
            }
            }

            glowObject.m_flRed = color.r() / 255.0f;
            glowObject.m_flGreen = color.g() / 255.0f;
            glowObject.m_flBlue = color.b() / 255.0f;
            glowObject.m_flAlpha = color.a() / 255.0f;
            glowObject.m_nGlowStyle = settings::visuals::glow::pulsestyle;
            glowObject.m_bRenderWhenOccluded = true;
            glowObject.m_bRenderWhenUnoccluded = false;
        }

    
    
    
    
    
    }
}



























































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































